import React from "react";
import './App.css';

function Neo({name, danger}) {
  const d_val = {danger} == true;
  console.log(d_val);
  const danger_str = (d_val ? "Yes" : "No");
  return(
    <div className="Neo">
      <h1> {name} </h1>
      <p> {danger_str} </p>
      <img src="" alt="" />
    </div>
  );
}

export default Neo;
